import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  min-height: 80vh;
  background-color: #24305e;
  padding: 15px;
  font-family: "Anton", sans-serif;
`;
const Card = styled.div`
  position: relative;
  height: 20vh;
  width: 100%;
  background-color: cadetblue;
  color: black;
  margin: 20px auto;
  padding-top: 1px;
  border-radius: 6px;
  filter: drop-shadow(5px 5px 5px black);
`;
const Text = styled.div`
  margin: 10px auto;
  width: 96%;
`;
export default function About() {
  return (
    <Wrapper>
      <Card>
        <Text>
          Hey, I'm Dennis.<br/> Tape is a small project to host my playlists in one
          place made with ReactJS, and deployed on Github pages. Check out my
          music page on Instagram!
        </Text>
      </Card>
    </Wrapper>
  );
}
